import React, { Component } from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardHeader,
  MDBBtn,
  MDBTable,
  MDBTableBody,
  MDBTableHead,
} from "mdbreact";

export class ListeReservationAide extends Component {
  render() {
    const data_panel = {
      columns: [

        {
          label: "Nom-Prénom",
          field: "first",
          sort: "asc",
        },
        {
          label: "Adresse",
          field: "last",
          sort: "asc",
        },
        {
          label: "Date",
          field: "username",
          sort: "asc",
        },
        {
          label: "Num-tél",
          field: "username2",
          sort: "asc",
        },
        {
          label: "Actions",
          field: "username3",
          sort: "asc",
        },
        {
          label: "Username",
          field: "username4",
          sort: "asc",
        },
      ],
      rows: [
        {
          first: "Mark",
          last: "Otto",
          username: "@mdo",
          username2: "Mark",
          username3: <MDBBtn outline rounded size="sm" color="white" className="px-2">
          <i className="fa fa-info-circle mt-0" style={{background}}></i>
        </MDBBtn>,
          username4: "@mdo",
        },
        {
          first: "Jacob",
          last: "Thornton",
          username: "@fat",
          username2: "Jacob",
          username3: "Thornton",
          username4: "@fat",
        },
        {
          first: "Larry",
          last: "the Bird",
          username: "@twitter",
          username2: "Larry",
          username3: "the Bird",
          username4: "@twitter",
        },
        {
          first: "Paul",
          last: "Topolski",
          username: "@P_Topolski",
          username2: "Paul",
          username3: "Topolski",
          username4: "@P_Topolski",
        },
        {

          first: "Larry",
          last: "the Bird",
          username: "@twitter",
          username2: "Larry",
          username3: "the Bird",
          username4: "@twitter",
        },
      ],
    };
    return (
      <MDBTable responsive>
      <div className="liste-reserv-aide container">
        <MDBCard narrow>
          <MDBCardHeader className="view view-cascade gradient-card-header blue-gradient d-flex justify-content-between align-items-center py-2 mx-4 mb-3">

            <a href="#" className="white-text mx-3">
              Table name
            </a>
            <div>
              <MDBBtn outline rounded size="sm" color="white" className="px-2">
                <i className="fas fa-pencil-alt mt-0"></i>
              </MDBBtn>
              <MDBBtn outline rounded size="sm" color="white" className="px-2">
                <i className="fas fa-times mt-0"></i>
              </MDBBtn>
              <MDBBtn outline rounded size="sm" color="white" className="px-2">
                <i className="fa fa-info-circle mt-0"></i>
              </MDBBtn>
            </div>
          </MDBCardHeader>
          <MDBCardBody cascade>
            <MDBTable btn fixed>
              <MDBTableHead columns={data_panel.columns} />
              <MDBTableBody rows={data_panel.rows} />
            </MDBTable>
          </MDBCardBody>
        </MDBCard>
      </div>
      </MDBTable>
    );
  }
}

export default ListeReservationAide;
